import React, {
    comments
} from "react";

export default class List extends comments {
    state = {
        list: [1,2,3],

    };
    render(){
        return (
            <div>
                {
                    this.state.list.map(item => {
                        return <li>{item}</li>
                    })
                }
            </div>
        )
    }
}
